INSERT INTO `products` (`ProductID`, `ProductName`, `SuppliesID`, `ProductImg`, `StandardCost`, `ProductStock`, `ProductDescribe`, `ProductStatus`) VALUES(2, '萊萃美高濃度魚油100粒', 2, 'https://ppc.easyopen.com.tw/Files/market/100883/image/MAI_161058121_X700X700.png', 500, 10, '高單位魚油幫助調節生理機能，促進代謝,含必須脂肪酸EPA及深海魚油可幫助您維護循環健康,並調節生理機能，讓您活力充沛,適合經常外食，飲食偏高油脂、低蔬果者', '1');
INSERT INTO `products` (`ProductID`, `ProductName`, `SuppliesID`, `ProductImg`, `StandardCost`, `ProductStock`, `ProductDescribe`, `ProductStatus`) VALUES(3, '萊萃美 維生素B群90粒二入組', 2, 'https://ppc.easyopen.com.tw/Files/market/100872/image/MAI_135605353_X700X700.png', 450, 10, '有助於維持能量正常代謝,提升工作活力,顆粒小，容易吞服', '1');
INSERT INTO `products` (`ProductID`, `ProductName`, `SuppliesID`, `ProductImg`, `StandardCost`, `ProductStock`, `ProductDescribe`, `ProductStatus`) VALUES(4, '萊萃美超級B群加C錠100錠', 2, 'https://ppc.easyopen.com.tw/Files/market/100881/image/MAI_143019840_X700X700.jpg', 790, 10, '多種B群完整組合有助於維持能量正常代謝。提升工作活力為每天的健康活力加分。添加高單位維生素C能促進膠原形成幫助鐵吸收具抗氧化作用。', '1');
INSERT INTO `products` (`ProductID`, `ProductName`, `SuppliesID`, `ProductImg`, `StandardCost`, `ProductStock`, `ProductDescribe`, `ProductStatus`) VALUES(5, '萊萃美葉黃素複方液態軟膠囊30粒', 2, 'https://ppc.easyopen.com.tw/Files/market/100871/image/MAI_112609364_X700X700.jpg', 650, 10, '食品添加物：葉黃素、氧化鋅、硫酸銅、＆beta;-胡蘿蔔素、混合生育醇維生素E、維生素C、維生素E、甘油、食用紅色40號鋁麗基、二氧化鈦、食用藍色2號鋁麗基、食用黃色5號鋁麗基', '1');
